function(num) {
  if (Math.abs(num) < 0.05) {
    // Round very small values near zero to 0
    return 0;
  } 

  if (num >= 10 || num < 0) {
    // For larger numbers and negative numbers, round to nearest integer
    return Math.round(num);
  }
  // For values less than 10 but greater than or equal to 0
  var factor = 100; // Scaling to 2 decimal places for precision
  var scaledNum = num * factor;
  var roundedNum = Math.round(scaledNum);  // Round to nearest integer
  return roundedNum / factor; // Return rounded value to 2 decimal places
}

